# Create Test Case V2 Tool Documentation

## Overview
The `testops_create_testcase` tool allows you to create new test cases in TestOps with structured scenarios, steps, and expected results. This is the enhanced version that supports string-based references for workflow, status, and test layer, along with comprehensive metadata management including parameters, links, tags, issues, test keys, members, and custom fields.

## Basic Usage

```json
{
  "projectId": 2298,
  "name": "My Test Case",
  "description": "Description of what this test case verifies",
  "precondition": "List of preconditions",
  "workflow": "Default Manual",
  "status": "Draft",
  "testLayer": "UI Tests",
  "scenario": {
    "steps": [
      {
        "type": "body",
        "body": "Step description"
      }
    ]
  }
}
```

## Required Fields
- `projectId` (number): The ID of the project where the test case will be created
- `name` (string): Name of the test case (minimum 1 character)

## Optional Fields
- `description` (string): Detailed description of the test case
- `precondition` (string): Prerequisites for running the test case
- `expectedResult` (string): Overall expected result of the test case
- `workflow` (string): Name of the workflow
- `status` (string): Name of the test case status
- `testLayer` (string): Name of the test layer
- `parameters` (array): List of test parameters with name and values
- `links` (array): List of external links with name and URL
- `tags` (array): List of tag names as strings
- `issues` (array): List of issues with integration name and issue key as value
- `testKeys` (array): List of test keys with integration name and test key as value
- `members` (array): List of members with role name and member name as value
- `customFields` (array): List of custom fields values with custom field name and custom field value as value
- `scenario` (object): Test case scenario with steps

