## Scenario Structure

### Step Types
1. Body Step
```json
{
  "type": "body",
  "body": "Step description",
  "steps": [], // Optional nested steps
  "expectedResultSteps": [] // Optional expected results
}
```

2. Attachment Step
```json
{
  "type": "attachment",
  "attachmentId": 123
}
```

3. Shared Step
```json
{
  "type": "shared",
  "sharedStepId": 456
}
```

4. Expected Result Step (only within expectedResultSteps)
```json
{
  "type": "expected_body",
  "body": "Expected result description"
}
```

## Validation Rules
1. Top-level steps must be of type "body", "attachment", or "shared"
2. Expected result steps can only be of type "expected_body" or "attachment"
3. Nested steps can appear under body steps
4. Expected result steps can be attached to any body step

