## Common Errors and Solutions

1. **Invalid Step Type**
   - Error: "Top level steps must be of type 'body', 'attachment', or 'shared'"
   - Solution: Ensure expected_body steps are only used within expectedResultSteps

2. **Missing Required Fields**
   - Error: "Required field missing"
   - Solution: Ensure projectId and name are provided

3. **Invalid Parameter Structure**
   - Error: "Invalid parameter format"
   - Solution: Ensure parameters have both 'name' and 'values' fields
   - Parameter name should be unique in the list of parameters

4. **Invalid Link Structure**
   - Error: "Invalid link format"
   - Solution: Ensure links have both 'name' and 'url' fields

## Best Practices

1. **Step Organization**
   - Keep steps focused and atomic
   - Use nested steps for related sub-steps
   - Attach expected results to appropriate steps

2. **Metadata Management**
   - Use meaningful parameter names
   - Provide descriptive links
   - Use consistent tag naming conventions
   - Link to relevant issues and requirements

3. **Documentation**
   - Provide clear descriptions
   - Include detailed preconditions
   - Use tags for better organization
   - Link to external documentation

